{"language":"Solidity","sources":{"contracts/walkwalk.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.19 <0.9.0;

contract WalkWalk {
    struct ExerciseData {
        uint timestamp;
        uint steps;
        uint duration;
        uint distance;
    }

    struct Receipt {
        string walletType;
        bool operator;
        uint price;
        string description;
        string createdAt;
        uint memberId;
    }

    // 유저 ID와 타임스탬프별로 운동 정보 배열을 저장하는 매핑
    mapping(uint => mapping(uint => ExerciseData[])) public exerciseRecordsByTimestamp;

    // 운동 데이터가 추가될 때 발생하는 이벤트
    event ExerciseDataAdded(uint memberId, uint timestamp, uint steps, uint duration, uint distance);

    // Receipt 데이터를 저장하는 배열
    Receipt[] public receipts;

    // Receipt 데이터가 추가될 때마다 발생하는 이벤트
    event ReceiptAdded(uint indexed receiptId, string walletType, bool operator, uint price, string description, string createdAt, uint memberId);

    // 운동 데이터를 추가하는 함수
    function addExerciseData(uint _memberId, uint _timestamp, uint _steps, uint _duration, uint _distance) public {
        // 지정된 타임스탬프의 운동 정보 배열에 새로운 데이터를 추가
        exerciseRecordsByTimestamp[_memberId][_timestamp].push(ExerciseData(_timestamp, _steps, _duration, _distance));
        
        // 이벤트 발생
        emit ExerciseDataAdded(_memberId, _timestamp, _steps, _duration, _distance);
    }

    // 특정 유저 ID와 타임스탬프로 운동 정보 배열을 조회하는 함수
    function getExerciseDataByTimestamp(uint _memberId, uint _timestamp) public view returns (ExerciseData[] memory) {
        return exerciseRecordsByTimestamp[_memberId][_timestamp];
    }

    // Receipt 데이터를 추가하는 함수
    function addReceipt(string memory _walletType, bool _operator, uint _price, string memory _description, string memory _createdAt, uint _memberId) public returns (uint) {
        receipts.push(Receipt(_walletType, _operator, _price, _description, _createdAt, _memberId));
        uint receiptId = receipts.length - 1;
        
        emit ReceiptAdded(receiptId, _walletType, _operator, _price, _description, _createdAt, _memberId);
        
        return receiptId;
    }

    // 특정 ID를 가진 Receipt 데이터를 조회하는 함수
    function getReceipt(uint _receiptId) public view returns (Receipt memory) {
        require(_receiptId < receipts.length, "Receipt does not exist.");
        return receipts[_receiptId];
    }
}
